query InvestorsAutocompleteQuery($name_or_firm: String, $first: Int) {
  investors(name_or_firm: $name_or_firm, first: $first) {
    edges {
      node {
        id
        person {
          id
          slug
          name
          first_name
          last_name
          __typename
        }
        firm {
          id
          name
          __typename
        }
        image_urls
        __typename
      }
      __typename
    }
    __typename
  }
  firms(search_name: $name_or_firm, first: $first) {
    edges {
      node {
        name
        slug
        id
        __typename
      }
      __typename
    }
    __typename
  }
}
